import React from "react";
import { HeaderWrapper } from "./header.styled";
const Header = () => {
  return (
    <HeaderWrapper>
      <h4>TEAM AXE</h4>
      <h4>Frontend</h4>
      <h4>Devs</h4>
    </HeaderWrapper>
  );
};

export default Header;
